import { Fragment } from "react";

function HomePage() {
  return (
    <Fragment>
      <h1>All Cops Are Bastards.</h1>
      <p>
        If you really think about it, getting paid to exercise power you were
        not granted explicitly is a mental disorder.
      </p>
    </Fragment>
  );
}

export default HomePage;
